【商品説明】<br>ひと夏生えない！速効性と持続性。<br>散布してから２～１０日で雑草は枯れ始め、約４～６ヵ月間、雑草の繁殖を抑えます。<br>しつこいスギナや生育期（草丈３０ｃｍ以下）の雑草にもよく効きます。土にまいても、茎葉にかけても、根まで枯らし、枯れムラが少ない強力処方です。<br>※土壌条件、気象条件により効果にムラが生じることがあります。<br>たっぷり大容量２？サイズ　広範囲にまきやすいジョウロヘッド採用！本剤２？で散布できる面積：約３３～６６ｍ２（約１０～２０坪）<br>使用方法用途など：<BR>・キャップを開けて、枯らしたい雑草に散布してください。※散布液が出にくい場合は、ボトル側面を軽く押してください。<br><br>適用雑草と使用方法　<br>作物名：　樹木等　<br>適用場所：　公園、庭園、堤とう、駐車場、道路、運動場、宅地等　<br>適用雑草名：　一年生及び多年生雑草　<br>使用時期：　雑草生育期（草丈３０ｃｍ以下）　<br>使用量：　３０～６０ｍ？／ｍ２　<br>本剤の使用回数：　２回以内　<br>使用方法：　植栽地を除く樹木等の周辺地に雑草茎葉散布又は全面土壌散布　<br>グリホサ<br><br>成分：<BR>グリホサートイソプロピルアミン塩　１．５％、ブロマシル　０．７５％、メコプロップＰカリウム塩　０．３０％、水、界面活性剤、<br>使用上の注意：<BR>【　効果・薬害等の注意　】　<br>●　薬剤が樹木等の植栽地に流入または飛散するおそれがある場所等では使用しない。　　　<br>●　本剤が植物の葉面や根から吸収されると薬害が発生するので、水田や水田への利用が考えられる用水路等に本剤の流入が想定される場所や、農作物および樹木等有用植物の付近では使用しない。　　　<br>●　傾斜地や砂質土壌では、本剤の流出による薬害の恐れがあるので使用しない。　　　<br>●　本剤を散布した場所やその付近では、有用植物の植付けは行わない。　　　<br>●　ハウス等の施設内お<br>保管および取扱い上の注意：<BR>直射日光をさけ、食品と区別して、子供の手の届かないなるべく低温な場所に密栓して保管する。<br>問い合わせ先：<BR>アース製薬株式会社 〒101-0048 東京都千代田区神田司町2-12-1 （お客様窓口)TEL0120-81-6456<br>原産国：日本<br>ブランド：アースガーデン<BR>商品サイズ：145×282×102<br>JANコード：4901080291714<BR>cs：6<BR>商品カテゴリ： 虫よけ・殺虫・園芸品 ＞ 園芸用品 ＞ 除草剤　(620000)<BR><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
